<!DOCTYPE html>
<html lang="ru" class="uk-height-1-1 tm-error" style="overflow-y: inherit; overflow-x: hidden">
<head>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />
<meta name="description" content="" />

<link href="css/theme.css" rel="stylesheet" type="text/css" />

<body class="uk-height-1-1 uk-vertical-align uk-text-center tm-comingsoon-page">

<div class="uk-vertical-align-middle uk-container-center tm-comingsoon">
    <div class="tm-comingsoon-box">
        <h1 class="tm-comingsoon-title">comming soon</h1>
        <p class="tm-comingsoon-msg">Neque porro quisquam est qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit.</p>
        <div>
            <div id="countdowntimer-3" class="widget CountDownTimer">
                <div id="countdowntimer-3-countdown" class="tminus_countdown" style="width:auto; height:auto;">
                    <div class="cutechurch-countdown ">
                        <div id="countdowntimer-3-tophtml" class="cutechurch-tophtml"></div>
                        <div id="countdowntimer-3-dashboard" class="cutechurch-dashboard">
                            <div class="cutechurch-dash cutechurch-weeks_dash">
                                <div class="cutechurch-dash_title">weeks</div>
                                <div class="cutechurch-digit">1</div>
                                <div class="cutechurch-digit">2</div>
                            </div>
                            <div class="cutechurch-dash cutechurch-days_dash">
                                <div class="cutechurch-dash_title">days</div>
                                <div class="cutechurch-digit">0</div>
                                <div class="cutechurch-digit">0</div>
                            </div>
                            <div class="cutechurch-dash cutechurch-hours_dash">
                                <div class="cutechurch-dash_title">hours</div>
                                <div class="cutechurch-digit">1</div>
                                <div class="cutechurch-digit">4</div>
                            </div>
                            <div class="cutechurch-dash cutechurch-minutes_dash">
                                <div class="cutechurch-dash_title">minutes</div>
                                <div class="cutechurch-digit">5</div>
                                <div class="cutechurch-digit">1</div>
                            </div>
                            <div class="cutechurch-dash cutechurch-seconds_dash">
                                <div class="cutechurch-dash_title">seconds</div>
                                <div class="cutechurch-digit">3</div>
                                <div class="cutechurch-digit">4</div>
                            </div>
                        </div>
                        <div id="countdowntimer-3-bothtml" class="cutechurch-bothtml"></div>
                    </div>
                </div>
            </div>
        </div>
    </div>
</div>
<script type="text/javascript" src="js/jquery.js"></script>
<script type="text/javascript" src="js/uikit.js"></script>
<script type="text/javascript" src="js/components/slider.js"></script>

<script type="text/javascript" src="js/components/lightbox.js"></script>
<script type="text/javascript" src="js/components/accordion.js"></script>
<script type="text/javascript" src="js/countdown.js"></script>
<script type="text/javascript" src="js/components/grid.js"></script>
<script type="text/javascript" src="js/components/sortable.js"></script>
<script type="text/javascript" src="js/custom.js"></script>

</body>
